// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity =0.7.6;
pragma abicoder v2;

import "@uniswap/v3-core/contracts/interfaces/callback/IUniswapV3FlashCallback.sol";
import "@uniswap/v3-core/contracts/libraries/LowGasSafeMath.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "hardhat/console.sol";
import "@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol";
import "@uniswap/v3-periphery/contracts/libraries/TransferHelper.sol";
import "@uniswap/v3-periphery/contracts/libraries/PoolAddress.sol";

interface UniswapRouter {
    struct PoolKey {
        address token0;
        address token1;
        uint24 fee;
    }

    function computeAddress(address factory, PoolKey memory key)
        external
        pure
        returns (address pool);
}


contract Interface {
    function balance(
        address _token,
        address acc,
        string memory _str
    ) public view returns (uint256) {
        uint256 qwe = IERC20(_token).balanceOf(acc);
        console.log("balance %s is %s", _str, qwe);
        return qwe;
    }

    function all(
        address _token,
        address owner,
        address sender
    ) public view returns (uint256) {
        IERC20 ERC20 = IERC20(_token);
        uint256 all1 = ERC20.allowance(owner, sender);
        return all1;
    }

    function approve(
        address _token,
        address _sender,
        uint256 _sum
    ) public {
        IERC20(_token).approve(_sender, _sum);
    }

    function transfer(
        address _token,
        uint256 amount,
        address recepient
    ) public returns (bool) {
        IERC20 ERC20 = IERC20(_token);
        return ERC20.transfer(recepient, amount);
    }

    function transferFrom(
        address _token,
        address sender,
        address dst,
        uint256 wad
    ) public returns (bool) {
        // if constract is msg.sender but not sender
        return IERC20(_token).transferFrom(sender, dst, wad);
    }

    function balanceMatic(address _address) public view returns (uint256) {
        console.log("balance Matic %s", _address.balance);
        return _address.balance;
    }

    function transferMatic_toContract(address payable _address) public payable {
        (bool sent, bytes memory data) = _address.call{value: msg.value}("");
    }

    function transferEth_fromContract(address payable _to, uint256 amount)
        public
        payable
    {
        payable(_to).transfer(amount);
    }

    function _msg() public view returns (address) {
        address qwe = msg.sender;
        console.log("msg.sender %s", qwe);
        return qwe;
    }

    ///uniswap
    function swapExactInputSingle(
        address inToken,
        address outToken,
        uint24 poolFee,
        uint256 amountIn
    ) public returns (uint256 amountOut) {
        address iSwapRouter = 0xE592427A0AEce92De3Edee1F18E0157C05861564;
        // approve(inToken, iSwapRouter, amountIn);
        TransferHelper.safeApprove(inToken,
            iSwapRouter,
            amountIn);
      
        approve(
            0x0d500B1d8E8eF31E21C99d1Db9A6444d3ADf1270,
            iSwapRouter,
            amountIn
        );
        ISwapRouter.ExactInputSingleParams memory params = ISwapRouter
            .ExactInputSingleParams({
                tokenIn: inToken,
                tokenOut: outToken,
                fee: poolFee,
                recipient: address(this),
                deadline: block.timestamp + 1000,
                amountIn: amountIn,
                amountOutMinimum: 0,
                sqrtPriceLimitX96: 0
            });
        amountOut = ISwapRouter(iSwapRouter).exactInputSingle(params);
    }

    function swapExactInputSingle_Approve(
        address inToken,
        address outToken,
        //uint24 poolFee,
        uint256 amountIn
    ) public returns (uint256 amountOut) {
        address iSwapRouter = 0xE592427A0AEce92De3Edee1F18E0157C05861564;
        // approve(inToken, iSwapRouter, amountIn);
        TransferHelper.safeApprove(inToken, iSwapRouter, amountIn);
        uint256 amountOut = all(inToken, address(this), iSwapRouter);

        /*    ISwapRouter.ExactInputSingleParams memory params = ISwapRouter
            .ExactInputSingleParams({
                tokenIn: inToken,
                tokenOut: outToken,
                fee: poolFee,
                recipient: address(this),
                deadline: block.timestamp + 1000,
                amountIn: amountIn,
                amountOutMinimum: 0,
                sqrtPriceLimitX96: 0
            }); */
        //amountOut = ISwapRouter(iSwapRouter).exactInputSingle(params);
    }

    function uniswapApprove(
        address inToken,
        address outToken,
        uint24 poolFee,
        uint256 amountIn
    ) public returns (uint256 amountOut) {
        address iSwapRouter = 0xE592427A0AEce92De3Edee1F18E0157C05861564;
        approve(inToken, iSwapRouter, amountIn);
        //  TransferHelper.safeApprove(inToken, iSwapRouter, amountIn);
        uint256 amountOut = all(inToken, address(this), iSwapRouter);

        //amountOut = ISwapRouter(iSwapRouter).exactInputSingle(params);
    }

    function poolAdress(
        address _token0,
        address _token1,
        uint24 _fee
    ) external view returns (address poolAddress) {
        PoolAddress.PoolKey memory poolKey = PoolAddress.PoolKey({
            token0: _token0,
            token1: _token1,
            fee: _fee
        });
        address _poolAddress = PoolAddress.computeAddress(
            0x1F98431c8aD98523631AE4a59f267346ea31F984,
            poolKey
        );
        console.log("pooladdress %s", _poolAddress);

        return _poolAddress;
    }


   

}

